INSERT INTO `imagen` (`id`, `nombre`, `tipo`, `contenido`) VALUES
	(4, 'La Industria Canaima C.A. participó en las mesas de negociación de la ExpoFeria Científica, Tecnológica e Industrial Irán-Venezuela que se realiza en el Poliedro de Caracas, informó la presidenta de la empresa, Isabel Piña.  Durante una entrevista realizada por Venezolana de Televisión, Piña mencionó que en la Expo, el stand ha recibido la visita de numerosos empresarios interesados en la tecnología; además, aseguró que están mostrando la calidad del producto que se ensambla en la industria venezolana.  Explicó que la empresa cuenta con una unidad de Desarrollo de Investigación Tecnológica “no solo somos una ensambladora, somos capaces de generar soluciones tecnológicas y ensamblar cualquier equipo tecnológico menor de 28 pulgadas”.  Resaltó que Canaima es un proyecto histórico creado por el Comandante Hugo Chávez y es parte de un sistema integral que incluye a la empresa, se encarga de ensamblar las computadoras; al Centro Nacional de Tecnologías de Información (CNTI) desarrolla los software y al Instituto Postal Telegráfico (Ipostel) ente que se encarga de la distribución.', 'image/jpeg', _binary ),
	(5, ' Anzoátegui, 27.05.2016 (Prensa MPPE).-El Gobierno Bolivariano liderado por el Presidente Nicolás Maduro a través del Ministerio del Poder Popular para la Educación articulado con la Gobernación del estado Anzoátegui continúa haciendo entrega de minilaptops y tabletas del Proyecto Canaima Educativo a estudiantes y docentes de la entidad.', 'image/png', _binary );
INSERT INTO `imagen` (`id`, `nombre`, `tipo`, `contenido`) VALUES
	(6, 'La Industria Canaima C.A. participó en las mesas de negociación de la ExpoFeria Científica, Tecnológica e Industrial Irán-Venezuela que se realiza en el Poliedro de Caracas, informó la presidenta de la empresa, Isabel Piña. Durante una entrevista realizada por Venezolana de Televisión, Piña mencionó que en la Expo, el stand ha recibido la visita de numerosos empresarios interesados en la tecnología; además, aseguró que están mostrando la calidad del producto que se ensambla en la industria venezolana. Explicó que la empresa cuenta con una unidad de Desarrollo de Investigación Tecnológica “no solo somos una ensambladora, somos capaces de generar soluciones tecnológicas y ensamblar cualquier equipo tecnológico menor de 28 pulgadas”. Resaltó que Canaima es un proyecto histórico creado por el Comandante Hugo Chávez y es parte de un sistema integral que incluye a la empresa, se encarga de ensamblar las computadoras; al Centro Nacional de Tecnologías de Información (CNTI) desarrolla los software y al Instituto Postal Telegráfico (Ipostel) ente que se encarga de la distribución.', 'image/png', _binary );

